          {
            "segment": {
              "endIndex": 103,
              "text": "Otters are carnivorous mammals known for their playful behavior and adaptations to a semi-aquatic life."
            },
            "groundingChunkIndices": [
              0,
              1
            ]
          },
          {
            "segment": {
              "startIndex": 104,
              "endIndex": 178,
              "text": "There are 14 known species of otters, which are part of the weasel family."
            },
            "groundingChunkIndices": [
              0
            ]
          },
          {
            "segment": {
              "startIndex": 180,
              "endIndex": 315,
              "text": "**Physical Characteristics:** Otters typically have long, slender bodies with short legs and powerful webbed feet perfect for swimming."
            },
            "groundingChunkIndices": [
              0,
              1,
              2
            ]
          },
          {
            "segment": {
              "startIndex": 316,
              "endIndex": 372,
              "text": "They possess dense, waterproof fur that keeps them warm."
            },
            "groundingChunkIndices": [
              0,
              3
            ]
          },
          {
            "segment": {
              "startIndex": 373,
              "endIndex": 482,
              "text": "Their size varies by species, ranging from about 2 to 6 feet in length and weighing between 6 and 100 pounds."
            },
            "groundingChunkIndices": [
              2
            ]
          },
          {
            "segment": {
              "startIndex": 484,
              "endIndex": 606,
              "text": "**Habitat and Diet:** Most otters live in and around freshwater rivers, lakes, and wetlands, while two species are marine."
            },
            "groundingChunkIndices": [
              0,
              1
            ]
          },
          {
            "segment": {
              "startIndex": 607,
              "endIndex": 714,
              "text": "Their diet is primarily carnivorous and consists of fish, crayfish, crabs, and other aquatic invertebrates."
            },
            "groundingChunkIndices": [
              4,
              0,
              5,
              6,
              7
            ]
          },
          {
            "segment": {
              "startIndex": 715,
              "endIndex": 793,
              "text": "Some species are adept at using tools, such as rocks, to break open shellfish."
            },
            "groundingChunkIndices": [
              0,
              8
            ]
          },
          {
            "segment": {
              "startIndex": 795,
              "endIndex": 908,
              "text": "**Behavior and Social Structure:** Otters are known for their playful nature, often seen sliding down riverbanks."
            },
            "groundingChunkIndices": [
              0,
              9,
              10
            ]
          },
          {
            "segment": {
              "startIndex": 909,
              "endIndex": 1002,
              "text": "Their social structure varies; some species are mostly solitary, while others live in groups."
            },
            "groundingChunkIndices": [
              0,
              3,
              11
            ]
          },
          {
            "segment": {
              "startIndex": 1003,
              "endIndex": 1079,
              "text": "They communicate through a variety of sounds, including whistles and chirps."
            },
            "groundingChunkIndices": [
              3
            ]
          },
          {
            "segment": {
              "startIndex": 1080,
              "endIndex": 1123,
              "text": "Otters can live up to 16 years in the wild."
